import React from "react"
import "./styles.css"
import Contacts from "./test"
import { ContactChip, Button } from "../../Components"

const StyledList = () => {
	return (
		<div className="List">
			<h1>Your Contacts</h1>
			<Button text={"Add contact"} />
			<div className="ContactList">{
				Contacts.map((contact) => {
					return <ContactChip contact={ contact } />
				}) 
			}</div>
		</div>
	)
}

export { StyledList }
